import React from "react";
import "../../assets/style.css"
import VideoCard from "../../components/Gallery";
import videos from "../../components/Gallery/videos.json";

//Home page
function Videos() {
    return (
       <Wrapper  className="homeBackground">
            <h1>My Videos</h1>
            <VideoCard/>

<div className="intro">
    Videos I have made.
</div>
<div className="videoCard">
    {videos.map(videos => <ProjectCard key={videos.id} videos={videos} />)}
</div>
</Wrapper>
    )
}

export default Videos
